Somos um site de classificados grátis com presença em todo o Brasil. Começamos nossas atividades em julho de 2011, dando início a nossa missão: ajudar as pessoas a comprar e vender bens e serviços na sua região de forma simples e prática.
faça um bom negócio
Nosso objetivo é oferecer um site de qualidade, rápido e fácil de usar, onde todas as pessoas possam publicar seus anúncios para vender, alugar ou trocar bens. Todos os nossos anúncios são distribuídos por região e categorias, como esportes, bebês e crianças, animais e acessórios, carros, etc.

Todos os dias milhares de novas ofertas são publicadas em nosso site, por isso, a nossa maior preocupação é a qualidade dos anúncios. Contamos com uma equipe de suporte aos usuários que, além de revisar todos anúncios publicados, busca também evitar fraudes, spam, conteúdo ofensivo e qualquer outra informação que possa prejudicar o usuário ou a sua busca. Há também a colaboração dos usuários, que podem comunicar qualquer dúvida ou irregularidade nos anúncios, além de dar sugestões para o site.

Por sermos um site classificados, nossa finalidade é unir compradores e vendedores do mesmo bairro, cidade ou região, que podem se encontrar pessoalmente para fechar o negócio.

O bomnegócio.com faz parte da Schibsted Media Group, um grupo de mídia Norueguês com presença global (schibsted.com) com mais de 150 anos de história operações em 27 países e mais de 7000 funcionários.
Quer comprar?

Buscas e filtros inteligentes ajudam a encontrar exatamente o que precisa;
Distinção entre anúncios particulares e de profissionais;
Qualidade: todos os anúncios são revisados pela nossa equipe, um por um;
Salve aquele anúncio ou busca que gostou para vê-lo depois.
Quer vender?

Fácil gerenciamento de anúncios sem burocracia;
Com a busca local, o seu anúncio é visto mais vezes;
Oportunidades iguais para todos os vendedores (profissionais ou particulares);
Compartilhe seu anúncio com seus amigos através dos links para as redes sociais.

