CaraguáNews conta com sua participação para garantir a interatividade. Acesse o espaço "Mande a notícia" e conte-nos o que você vê.

A Construção Mercado é uma revista nacional, de periodicidade mensal, com reportagens aprofundadas sobre os negócios de Construção e Incorporação. É voltada a todos os profissionais do setor que buscam informações e análises que contribuam para o aumento do profissionalismo e competitividade dos negócios.
A revista é editada pelo Grupo PINI, que há 65 anos fornece informações especializadas à construção civil.

HISTÓRICO
A revista Construção Mercado foi lançada em agosto de 2001, a partir da fusão da antiga revista Construção São Paulo, criada em 1948, e suas edições regionais mensais: Rio de Janeiro, Região Sul, Minas/Centro-Oeste e Norte/Nordeste.

PRINCIPAIS TEMAS:
Análise e viabilidade de empreendimentos;
Tendências do mercado imobiliário;
Gestão empresarial e da produção;
Novas oportunidades de negócios;
Mecanismos de financiamento à produção e aquisição de imóveis;
Obras e negócios na área de infra-estrutura e construção pesada;
Política e conjuntura econômica setorial;
Legislação relativa às atividades de construção e incorporação;
Responsabilidade social e sustentabilidade na indústria da construção civil;
Vendas e Marketing;
Exportação de serviços.

