A Tribuna do Ceará, nome conhecido por sua trajetória como veículo impresso, volta a fazer parte da vida do cearense de uma nova maneira. A Tribuna está na rede. A Tribuna nasce em permanente construção, unindo-se à TV Jangadeiro, Nordestv, Jangadeiro FM e Tríbuna BandNewsFM.

Aqui você encontra notícias e informações sobre o Ceará e os cearenses. Discordar de algum conteúdo é parte do jogo e da convivência, mas é fundamental que as manifestações sejam pautadas pelo respeito ao outro.

Ninguém gosta de ler ataques pessoais, palavras obscenas, textos comerciais e spam. Esperamos que os usuários não apresentem insultos, difamações e links que não estejam relacionados ao assunto discutido no post.

Qualquer conteúdo que recaia sobre as categorias a seguir estão sujeitos à avaliação da equipe de Mídias Sociais e podem ser deletados.

- Sejam abusivos, difamatórios ou obscenos;
- Sejam fraudulentos, capciosos ou que induzam a erro;
- Violem qualquer lei, norma ou regulamento;
- Violem qualquer direito de propriedade intelectual ou outros direitos;
- Sejam ofensivas sob qualquer outro aspecto.

Contamos com a colaboração com a participação de todos! Obrigado!
